import { SelectionModel } from '@angular/cdk/collections';
import { Component, OnInit, ViewChild } from '@angular/core';
import { MatDialog, MatDialogConfig } from '@angular/material/dialog';
import { MatPaginator } from '@angular/material/paginator';
import { MatSort } from '@angular/material/sort';
import { MatTableDataSource } from '@angular/material/table';
import { ActivatedRoute, Router } from '@angular/router';
import { ConfigService } from 'src/app/core/services/config.service';
import { MappingService } from 'src/app/core/services/mapping.service';
import { BrandProtection } from 'src/app/core/services/models/brand-protection.model';
import { DialogComponentComponent } from 'src/app/core/shared/dialog/dialog-component/dialog-component.component';

@Component({
  selector: 'app-repo-sub-items',
  templateUrl: './repo-sub-items.component.html',
  styleUrls: ['./repo-sub-items.component.scss']
})
export class RepoSubItemsComponent implements OnInit {

  displayedColumns: string[] = [
    "select",
    'sNo',
    'name',
    'year',
    'city',
    'status'
  ];
  dataSource!: MatTableDataSource<any>;
  selection = new SelectionModel<any>(true, []);

  @ViewChild("paginator") paginator!: MatPaginator;
  @ViewChild(MatSort) sort!: MatSort;

  pageSize = 10; // by default
  length: number = 0;
  pageIndex = 0;
  pageSizeOptions = [10, 25, 50, 100];
  clickedRows = new Set<any>();
  trademarks: any = [];

  constructor(
    private configService: ConfigService,
    private mappingService: MappingService,
    private activatedRoute: ActivatedRoute,
    private router: Router,
    private dialog: MatDialog
  ) {
    // Create 100 users

    // const users = Array.from({length: 100}, (_, k) => createNewUser(k + 1));
  }
  ngOnInit(): void {
    this.fetchBrandProtections();
  }

  ngAfterViewInit() {
    // this.dataSource.sort = this.sort;
    this.dataSource.paginator = this.paginator;
  }

  applyFilter(event: Event) {
    const filterValue = (event.target as HTMLInputElement).value;
    this.dataSource.filter = filterValue.trim().toLowerCase();

    if (this.dataSource.paginator) {
      this.dataSource.paginator.firstPage();
    }
  }

  fetchBrandProtections() {
    this.trademarks = [
      {name: '../../../../assets/img/pdf.png', year: 'National Foods’ “Signature Dish” Brings Unsung Chefs to Limelight', city: "Karachi, 21 March 2023: National Foods Limited has launched the ‘Signature Dish’ campaign to highlight the unsung heroes of Pakistan’s culinary world. The Food Services Division of National Foods pays tribute to the legendary chefs who are masters in their field and are behind the delicious cuisines made in popular restaurants of Pakistan. The campaign has been launched recently to feature Pakistan’s acclaimed chefs and their ‘signature dishes’."},
      {name: '../../../../assets/img/pdf.png', year: 'National Foods partners with WWF for ‘LetsPlantOurFuture’ Campaign', city: 'Karachi: July 2021 — With a vision to combine its industry leadership with sustainable practices, National Foods Limited (NFL) has collaborated with World Wildlife Fund (WWF) in Pakistan to protect the environment by reducing its carbon footprint, encouraging tree plantation and reforestation. Through this resourceful collaboration for NFL’s #LetsPlantOurFuture campaign, thousands of mangrove saplings are being planted which are critical to the conversation of marine life and those dependent on it along Pakistan’s coastal areas, along with other public-awareness drives under the company’s Eco-Friendly Initiative. This initiative encompasses a series of Sustainability activities including reduction of the paper usage in packaging of its Recipe Mixes category by up to 25%, which in turn will result in reduced tree felling of hundreds of trees.'},
      {name: '../../../../assets/img/doc.png', year: 'National Foods Unveils New Packaging of Pakistan’s No. 1 Recipe Mixes', city: 'Karachi, May 16, 2022: The leading food brand of Pakistan; National Foods is making strides towards a more innovative approach and has officially launched the redesigned packaging of Pakistan’s No. 1 Recipe Mixes brand (as per Foresight Household Panel ’22). The pack communication is clean and easy to navigate, with ingredients always being the hero. The revamped design of recipe mixes range revolves around concept of diverse and vibrant colors which depict the rich culture, tradition and the proud nation of Pakistan. Each category is marked with distinguishing colors; the rice range is marked with a beautiful mustard whereas the Salan (Curry) range is depicted via a gorgeous purple. Fried range is shocking pink whereas a deep maroon brings in vitality to the succulent BBQ range.'},
    ];
    this.dataSource = new MatTableDataSource(this.trademarks);
      this.length = this.trademarks.length;
      this.dataSource.paginator = this.paginator;
      this.dataSource.sort = this.sort;
  }

  isAllSelected() {
    const numSelected = this.selection.selected.length;
    const numRows = this.dataSource.data.length;
    return numSelected === numRows;
  }


  toggleAllRows() {
    if (this.isAllSelected()) {
      this.selection.clear();
      return;
    }
    this.selection.select(...this.dataSource.data);
  }

  checkboxLabel(row?: BrandProtection): string {
    if (!row) {
      return `${this.isAllSelected() ? 'deselect' : 'select'} all`;
    }
    return `${this.selection.isSelected(row) ? 'deselect' : 'select'} row ${+1}`;
  }

  onAdd() {
    this.router.navigate(['add'], { relativeTo: this.activatedRoute });
  }

  onUpdate() {
    // this.id = +this.router.snapshot.paramMap.get('id');
    console.log("onUpdate this.selection", this.selection)
    if (this.selection.selected.length > 0) {
      let id = this.selection.selected[0].id;
      this.router.navigate(['edit/', id], { relativeTo: this.activatedRoute });
    }
  }

  async onDelete() {
    let id = this.selection.selected[0].id;
    if (id) {
      try {
        this.configService.deleteTrademark(id).subscribe((res: {}) => {
          if (res) {
            this.selection.clear();
            this.fetchBrandProtections();
          } else {
            alert('Failed to delete record');
          }
        });
      } catch (error) {
        console.error(error);
      }
    } else {
      alert('Error in selection. Invalid');
    }
  }

  onView()
  {
    // var blobURL = "..\..\..\assets\file\MayTaxFiling.pdf";
    var blobURL = 
    ""
    // window.open(blobURL);
    const dialogConfig = new MatDialogConfig();

    dialogConfig.disableClose = true;
    dialogConfig.autoFocus = true;

    const dialogRef = this.dialog.open(DialogComponentComponent, {
      width: '600px',
      height: '800px',
      data: blobURL
    });
  }

}
